    function drawState(state, color, onlyDrawInside) {
        if (!color) {
            color = '#FF0000';
        }
        var translation = [0,0];
        translation = scalePoint([-43.12533, -131.9412]);
        translation = scalePoint([0, -131.9412]);
        //alert('state: ' + state + ', translation ' + translation);
        drawSvgPath(stateSvgPaths[state], translation, color, 1, onlyDrawInside ? DRAW_SVG_ONLYFILL : DRAW_SVG_FILL);
        if (state in statenameboxSvgPaths) {
            drawSvgPath(statenameboxSvgPaths[state], translation, color, 1, DRAW_SVG_ONLYFILL);
        }
    }
    function drawStateName(stateName) {
        var im = new Image();
        statenameimages[stateName] = im;
        var translation = scalePoint([0, -131.9412]);
        im.onload = function() {
            var point = scalePoint(statenamepositions[stateName]);
            //alert('drawing at ' + point);
            ctx.save();
            ctx.translate(translation[0], translation[1]);
            ctx.drawImage(im, point[0], point[1] - (im.height*(800.0/958.69)/2), im.width*(800.0/958.69), im.height*(800.0/958.69));
            ctx.restore();
        }
        im.src = 'svg/statenameimages/' + stateName + '.png';
    }
    function scalePoint(point) {
        return point.map(function(x) { return x * (800.0/958.69);});
    }
    function getPoint(point) {
        var tempPoint = point.split(',').map(function(x) {return parseFloat(x);});
        // Scale it.
        return scalePoint(tempPoint);
    }

    var DRAW_SVG_FILL = 0;
    var DRAW_SVG_NOFILL = 1;
    var DRAW_SVG_ONLYFILL = 2;
    function drawSvgPath(data, translation, color, width, fillMode) {
        if (!fillMode) {
            fillMode = 0;
        }
        var commands = data.split(' ');
        var index = 0;
        var curPoint = [0,0];
        ctx.strokeStyle = "black";
        ctx.lineWidth = width;
        ctx.fillStyle = color;

        ctx.save();
        if (!(translation[0] == 0 && translation[1] == 0)) {
            ctx.translate(translation[0], translation[1]);
            //alert('translated ' + translation);
        }
        ctx.beginPath();
        while (index < commands.length) {
            var command = commands[index++];
            switch (command) {
                case 'M':
                    // Move
                    var pointCoords = getPoint(commands[index++]);
                    ctx.moveTo(pointCoords[0], pointCoords[1]);
                    //alert('m ' + pointCoords[0] + ' ' + pointCoords[1]);
                    curPoint = [pointCoords[0], pointCoords[1]];
                    break;
                case 'L':
                    // Straight line
                    var pointCoords = getPoint(commands[index++]);
                    ctx.lineTo(pointCoords[0], pointCoords[1]);
                    //alert('L ' + pointCoords[0] + ' ' + pointCoords[1]);
                    curPoint = [pointCoords[0], pointCoords[1]];
                    break;
                case 'C':
                    // Cubic Bezier curve
                    var point1 = getPoint(commands[index++]);
                    var point2 = getPoint(commands[index++]);
                    var point3 = getPoint(commands[index++]);
                    ctx.bezierCurveTo(point1[0], point1[1], point2[0], point2[1], point3[0], point3[1]);
                    //alert('C ' + pointCoords[0] + ' ' + pointCoords[1]);
                    curPoint = [point3[0], point3[1]];
                    break;
 
                case 'z':
                    // Close path
                    // TODO - filling, stuff go here.
                    ctx.closePath();
                    if (fillMode == DRAW_SVG_FILL || fillMode == DRAW_SVG_NOFILL) {
                        ctx.stroke();
                    }
                    if (fillMode == DRAW_SVG_FILL || fillMode == DRAW_SVG_ONLYFILL) {
                        ctx.fill();
                    }
                    ctx.beginPath();
                    break;
                case '':
                    // just at end of string, no worries
                    break;
                default:
                    alert('unknown command "' + command + '" at position ' + index + ' (curPoint ' + curPoint + ')');
                    index = commands.length;
            }
        }
        if (fillMode == DRAW_SVG_FILL || fillMode == DRAW_SVG_NOFILL) {
            ctx.stroke();
        }
        if (fillMode == DRAW_SVG_FILL || fillMode == DRAW_SVG_ONLYFILL) {
            ctx.fill();
        }
        ctx.restore();
    }

